/*
 * Outputs for enable system:
 *    '<S112>/Calculate_D_term'
 *    '<S150>/Calculate_D_term'
 *    '<S244>/Calculate_D_term'
 */
void L4_MABX_Calculate_D_term(boolean_T rtu_Enable, real_T rtu_GPID_Kd, real_T
  rtu_GPID_dT, boolean_T rtu_F_GPID_reset_gov, real_T rtu_GPID_control_error,
  real_T rtu_GPID_T_filt_d, B_Calculate_D_term_L4_MABX_T *localB,
  DW_Calculate_D_term_L4_MABX_T *localDW, P_Calculate_D_term_L4_MABX_T *localP)
{
  real_T maxV;
  real_T u1;
  real_T u2;

  /* Outputs for Enabled SubSystem: '<S112>/Calculate_D_term' incorporates:
   *  EnablePort: '<S116>/Enable'
   */
  if (rtu_Enable) {
    if (!localDW->Calculate_D_term_MODE) {
      L4_M_Calculate_D_term_Reset(localDW, localP);
      localDW->Calculate_D_term_MODE = true;
    }

    /* UnitDelay: '<S121>/Unit_Delay1' */
    localB->Unit_Delay1 = localDW->Unit_Delay1_DSTATE;

    /* Logic: '<S121>/Logical Operator' */
    localB->LogicalOperator = (rtu_F_GPID_reset_gov || localB->Unit_Delay1);

    /* MinMax: '<S121>/MinMax1' */
    if ((rtu_GPID_dT > rtu_GPID_T_filt_d) || rtIsNaN(rtu_GPID_T_filt_d)) {
      maxV = rtu_GPID_dT;
    } else {
      maxV = rtu_GPID_T_filt_d;
    }

    localB->MinMax1 = maxV;

    /* End of MinMax: '<S121>/MinMax1' */

    /* Saturate: '<S121>/Saturation' */
    maxV = localB->MinMax1;
    u1 = localP->Saturation_LowerSat;
    u2 = localP->Saturation_UpperSat;
    if (maxV > u2) {
      localB->Saturation = u2;
    } else if (maxV < u1) {
      localB->Saturation = u1;
    } else {
      localB->Saturation = maxV;
    }

    /* End of Saturate: '<S121>/Saturation' */

    /* Product: '<S121>/Divide' */
    localB->Divide = rtu_GPID_dT / localB->Saturation;

    /* Product: '<S121>/Product2' */
    localB->Product2 = rtu_GPID_control_error * localB->Divide;

    /* Sum: '<S121>/Subtract1' incorporates:
     *  Constant: '<S121>/Constant1'
     */
    localB->Subtract1 = localP->Constant1_Value - localB->Divide;

    /* UnitDelay: '<S121>/Unit_Delay2' */
    localB->Unit_Delay2 = localDW->Unit_Delay2_DSTATE;

    /* Product: '<S121>/Product1' */
    localB->Product1 = localB->Subtract1 * localB->Unit_Delay2;

    /* Sum: '<S121>/Add1' */
    localB->Add1 = localB->Product2 + localB->Product1;

    /* Outputs for Atomic SubSystem: '<S121>/If_Then_Else' */
    L4_MABX_If_Then_Else(localB->LogicalOperator, rtu_GPID_control_error,
                         localB->Add1, &localB->If_Then_Else);

    /* End of Outputs for SubSystem: '<S121>/If_Then_Else' */

    /* Product: '<S116>/Divide' */
    localB->Divide_k = localB->If_Then_Else.Switch / rtu_GPID_dT * rtu_GPID_Kd;

    /* UnitDelay: '<S122>/FixPt Unit Delay2' */
    localB->FixPtUnitDelay2 = localDW->FixPtUnitDelay2_DSTATE;

    /* Logic: '<S122>/FixPt Logical Operator' */
    localB->FixPtLogicalOperator = (uint8_T)(rtu_F_GPID_reset_gov ||
      (localB->FixPtUnitDelay2 != 0));

    /* UnitDelay: '<S122>/FixPt Unit Delay1' */
    localB->Xold = localDW->FixPtUnitDelay1_DSTATE;

    /* Switch: '<S122>/Init' */
    if (localB->FixPtLogicalOperator != 0) {
      localB->Init = localB->Divide_k;
    } else {
      localB->Init = localB->Xold;
    }

    /* End of Switch: '<S122>/Init' */

    /* Sum: '<S116>/Subtract' */
    localB->Subtract = localB->Divide_k - localB->Init;

    /* Switch: '<S122>/Reset' */
    localB->Xnew = localB->Divide_k;
  } else {
    if (localDW->Calculate_D_term_MODE) {
      L4_Calculate_D_term_Disable(localB, localDW, localP);
    }
  }

  /* End of Outputs for SubSystem: '<S112>/Calculate_D_term' */
}

